mod U256;
use U256::U256Bytes;

struct InUtxo {
    deposit_hash: [u8; 32],
    amount: [u8; 32],
    signature: [u8; 64],
    nullifier_hash: [u8; 32],
}

struct Utxo {
    contract_address: [u8; 20],
    amount: [u8; 32],
    deposit_hash: [u8; 32],
    nullifier_hash: [u8; 32],
}

impl Utxo {
    fn new(
        contract_address: [u8; 20],
        amount: [u8; 32],
        deposit_hash: [u8; 32],
        nullifier_hash: [u8; 32],
    ) -> Self {
        Self { contract_address, amount, deposit_hash, nullifier_hash }
    }

    fn to_bytes(self) -> [u8; 116] {
        let mut utxo_bytes: [u8; 116] = [0; 116];

        for i in 0..20 {
            utxo_bytes[i] = self.contract_address[i];
        }
        for i in 20..52 {
            utxo_bytes[i] = self.amount[i - 20];
        }
        for i in 52..84 {
            utxo_bytes[i] = self.deposit_hash[i - 52];
        }
        for i in 84..116 {
            utxo_bytes[i] = self.nullifier_hash[i - 84];
        }
        utxo_bytes
    }
}

unconstrained fn check_utxo(
    utxo: InUtxo,
    contract_address: [u8; 20],
    utxo_commitment: [u8; 32],
    ownership_commitment: [u8; 32],
    public_key_x: [u8; 32],
    public_key_y: [u8; 32],
) -> U256Bytes {
    // check is the signature is created with that utxo deposit hash
    assert(std::ecdsa_secp256k1::verify_signature(
        public_key_x,
        public_key_y,
        utxo.signature,
        utxo.deposit_hash,
    ));

    let calc_ownership_commitment = std::hash::keccak256(utxo.signature, 64);

    assert(calc_ownership_commitment == ownership_commitment);

    let utxo_bytes = Utxo::new(
        contract_address,
        utxo.amount,
        utxo.deposit_hash,
        utxo.nullifier_hash,
    )
        .to_bytes();

    let digest = std::hash::keccak256(utxo_bytes, 116);

    assert(digest == utxo_commitment);

    U256Bytes::new(utxo.amount)
}

pub struct ReturnValues {
    utxo_commitments: [[u8; 32]; 2],
    utxo_bytes: [[u8; 116]; 2],
}

unconstrained fn main(
    utxos: [InUtxo; 3],
    public_key_x: [u8; 32],
    public_key_y: [u8; 32],
    utxo_commitments: pub [[u8; 32]; 3],
    ownership_commitments: pub [[u8; 32]; 3],
    utxo_len: u8,
    contract_address: [u8; 20],
    send_amount: [u8; 32],
    send_deposit_hash: pub [u8; 32],
    left_deposit_hash: pub [u8; 32],
    nullifier_hash: [u8; 32],
) -> pub ReturnValues {
    assert(utxo_len < 4);
    let mut amount = U256Bytes::zero();

    let send_amount = U256Bytes::new(send_amount);

    for i in 0..utxo_len {
        let utxo_amount = check_utxo(
            utxos[i],
            contract_address,
            utxo_commitments[i],
            ownership_commitments[i],
            public_key_x,
            public_key_y,
        );
        amount += utxo_amount;
    }

    assert(send_amount <= amount);

    let left_amount = amount - send_amount;

    let left_utxo_bytes = Utxo::new(
        contract_address,
        left_amount.limbs,
        left_deposit_hash,
        nullifier_hash,
    )
        .to_bytes();

    let send_utxo_bytes = Utxo::new(
        contract_address,
        send_amount.limbs,
        send_deposit_hash,
        nullifier_hash,
    )
        .to_bytes();

    let send_utxo_bytes_hash = std::hash::keccak256(send_utxo_bytes, 116);
    let left_utxo_bytes_hash = std::hash::keccak256(left_utxo_bytes, 116);

    ReturnValues {
        utxo_commitments: [send_utxo_bytes_hash, left_utxo_bytes_hash],
        utxo_bytes: [send_utxo_bytes, left_utxo_bytes],
    }
}

